import React from 'react';
import TextField from '@material-ui/core/TextField';
import { makeStyles } from '@material-ui/core/styles';
import MenuItem from '@material-ui/core/MenuItem';
import {Grid,Paper} from "@material-ui/core";


const currencies = [
  {
    value: 'USD',
    label: '$',
  },
  {
    value: 'EUR',
    label: '€',
  },
  {
    value: 'BTC',
    label: '฿',
  },
  {
    value: 'JPY',
    label: '¥',
  },
];

const useStyles = makeStyles((theme) => ({
  root: {
    '& .MuiTextField-root': {
      margin: theme.spacing(1),
      // width: '25ch',
    },
  },
  textchange:{
    width:'50%',
  },
}));




const Profile = () => {
  const classes = useStyles();
  const [currency, setCurrency] = React.useState('EUR');

  const handleChange = (event) => {
    setCurrency(event.target.value);
  };

  return (
  <div className="profile">
     <form className={classes.root} noValidate autoComplete="off">
      <div className ={classes.textchange}>
        <TextField
          required
          id="filled-required"
          label="First Name"
          defaultValue=""
          variant="filled"
        />
        <TextField
          disabled
          id="filled-disabled"
          label="Last Name"
          defaultValue=""
          variant="filled"
        />
    
       
      </div>
      <div className ={classes.textchange}>
        <TextField
          required
          id="filled-required"
          label="Email Address"
          defaultValue="Hello World"
          variant="filled"
        />
        <TextField
          disabled
          id="filled-disabled"
          label="Username"
          defaultValue=" "
          variant="filled"
        />
    
       
      </div>
     
      <div className ={classes.textchange}>
        <TextField
          id="outlined-select-currency"
          select
          label="Select"
          value={currency}
          onChange={handleChange}
          helperText="Please select your currency"
          variant="outlined"
        >
          {currencies.map((option) => (
            <MenuItem key={option.value} value={option.value}>
              {option.label}
            </MenuItem>
          ))}
        </TextField>
        
        <TextField
          id="outlined-select-currency-native"
          select
          label=" select"
          value={currency}
          onChange={handleChange}
          SelectProps={{
            native: true,
          }}
          helperText="Please select your currency"
          variant="outlined"
        >
          {currencies.map((option) => (
            <option key={option.value} value={option.value}>
              {option.label}
            </option>
          ))}
        </TextField>
      </div>

      <div>
        <TextField
          required
          id="filled-required"
          label="Occupation"
          defaultValue=" "
          variant="filled"
        />
        
        <TextField
          id="outlined-select-currency-native"
          select
          label=" select"
          value={currency}
          onChange={handleChange}
          SelectProps={{
            native: true,
          }}
          helperText="Please select your currency"
          variant="outlined"
        >
          {currencies.map((option) => (
            <option key={option.value} value={option.value}>
              {option.label}
            </option>
          ))}
        </TextField>
    
       
      </div>
      

      <div>
        <TextField
          required
          id="filled-required"
          label="Occupation"
          defaultValue=" "
          variant="filled"
        />
        <TextField
          disabled
          id="filled-disabled"
          label="Date"
          defaultValue=" "
          variant="filled"
        />
    
       
      </div>
    </form>
    </div>
  );
}

export default Profile;
